member.summary:
This allows you to forward serialization of an object to one of its members. For example,

[fsForward("Values")]
struct Wrapper {
  public int[] Values;
}

Then `Wrapper` will be serialized into a JSON array of integers. It will be as if `Wrapper`
doesn't exist.

If exceptions are allowed internally, then additional date formats can be deserialized.
Note that the Full Serializer public API will *not* throw exceptions with this enabled;
errors will still be returned in a fsResult instance.

Convert a C# field/property name into the key used for the JSON object. For example, you could force all JSON names to lowercase with:
fsConfig.GetJsonNameFromMemberName = (name, info) => name.ToLower();
This will only be used when the name is not explicitly specified with fsProperty.

example.code:
using System;
using System.Text;
using System.Collections;
using System.IO;

using ICSharpCode.SharpZipLib.Zip;

class MainClass
{
	static public void Main(string[] args)
	{
		using (ZipFile zFile = new ZipFile(args[0])) {
			Console.WriteLine("Listing of : " + zFile.Name);
			Console.WriteLine("");
			Console.WriteLine("Raw Size    Size      Date     Time     Name");
			Console.WriteLine("--------  --------  --------  ------  ---------");
			foreach (ZipEntry e in zFile) {
				if ( e.IsFile ) {
					DateTime d = e.DateTime;
					Console.WriteLine("{0, -10}{1, -10}{2}  {3}   {4}", e.Size, e.CompressedSize,
						d.ToString("dd-MM-yy"), d.ToString("HH:mm"),
						e.Name);
				}
			}
		}
	}
}

member.example:
This sample shows how to read a zip file

            using System;
            using System.Text;
            using System.IO;

            using ICSharpCode.SharpZipLib.Zip;

            class MainClass
            {
            	public static void Main(string[] args)
            	{
            		using ( ZipInputStream s = new ZipInputStream(File.OpenRead(args[0]))) {

            			ZipEntry theEntry;
            			const int size = 2048;
            			byte[] data = new byte[2048];

            			while ((theEntry = s.GetNextEntry()) != null) {
                            if ( entry.IsFile ) {
            				    Console.Write("Show contents (y/n) ?");
            				    if (Console.ReadLine() == "y") {
            				    	while (true) {
            				    		size = s.Read(data, 0, data.Length);
            				    		if (size > 0) {
            				    			Console.Write(new ASCIIEncoding().GetString(data, 0, size));
            				    		} else {
            				    			break;
            				    		}
            				    	}
            				    }
            				}
            			}
            		}
            	}
            }

This sample shows how to create a zip file

            using System;
            using System.IO;

            using ICSharpCode.SharpZipLib.Core;
            using ICSharpCode.SharpZipLib.Zip;

            class MainClass
            {
            	public static void Main(string[] args)
            	{
            		string[] filenames = Directory.GetFiles(args[0]);
            		byte[] buffer = new byte[4096];

            		using ( ZipOutputStream s = new ZipOutputStream(File.Create(args[1])) ) {

            			s.SetLevel(9); // 0 - store only to 9 - means best compression

            			foreach (string file in filenames) {
            				ZipEntry entry = new ZipEntry(file);
            				s.PutNextEntry(entry);

            				using (FileStream fs = File.OpenRead(file)) {
           						StreamUtils.Copy(fs, s, buffer);
            				}
            			}
            		}
            	}
            }

This sample shows how to unzip a gzipped file

           using System;
           using System.IO;

           using ICSharpCode.SharpZipLib.Core;
           using ICSharpCode.SharpZipLib.GZip;

           class MainClass
           {
           	public static void Main(string[] args)
           	{
           		using (Stream inStream = new GZipInputStream(File.OpenRead(args[0])))
           		using (FileStream outStream = File.Create(Path.GetFileNameWithoutExtension(args[0]))) {
           			byte[] buffer = new byte[4096];
           			StreamUtils.Copy(inStream, outStream, buffer);
           		}
           	}
           }

This sample shows how to gzip a file

            using System;
            using System.IO;

            using ICSharpCode.SharpZipLib.GZip;
            using ICSharpCode.SharpZipLib.Core;

            class MainClass
            {
            	public static void Main(string[] args)
            	{
            			using (Stream s = new GZipOutputStream(File.Create(args[0] + ".gz")))
            			using (FileStream fs = File.OpenRead(args[0])) {
            				byte[] writeData = new byte[4096];
            				Streamutils.Copy(s, fs, writeData);
            			}
            		}
            	}
            }

This sample shows how to unzip a compressed file

            using System;
            using System.IO;

            using ICSharpCode.SharpZipLib.Core;
            using ICSharpCode.SharpZipLib.LZW;

            class MainClass
            {
            	public static void Main(string[] args)
            	{
           			using (Stream inStream = new LzwInputStream(File.OpenRead(args[0])))
           			using (FileStream outStream = File.Create(Path.GetFileNameWithoutExtension(args[0]))) {
           				byte[] buffer = new byte[4096];
           				StreamUtils.Copy(inStream, outStream, buffer);
                                    // OR
                                    inStream.Read(buffer, 0, buffer.Length);
                                    // now do something with the buffer
            		}
            	}
            }

member.summary:
Using this,you can optimize string concat operation easily. To use this , you should put this on the top of code. ------ using StrOpe = StringOperationUtil.OptimizedStringOperation; ------
- before code string str = "aaa" + 20 + "bbbb";
- after code string str = StrOpe.i + "aaa" + 20 + "bbbb";
"StrOpe.i" is for MainThread , do not call from other theads. If "StrOpe.i" is called from Mainthread , reuse same object.
You can also use "StrOpe.small" / "StrOpe.medium" / "StrOpe.large" instead of "StrOpe.i". These are creating instance.
